import React from "react";

const Congrats = (props) => {
  const startQuiz = (e) => {
    e.preventDefault();
    console.log(e);

    //this will help us from not reloading page again and again

    props.setPageNumber(3);
  };
  return (
    props.isShowing && (
      <div className="modal-content">
        <h2>congrats!</h2>
        <p>You answered 0% of questions correctly</p>
        {/* <button className="close-btn">play again</button> */}
        <button
          type="submit"
          className="close-btn"
          onClick={(e) => startQuiz(e)}
        >
          Start
        </button>
      </div>
    )
  );
};

export default Congrats;
